import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Nav from './Components/Nav';
import Home from "./Components/Home"

function App() {
  return (



    <BrowserRouter>
    <Routes>
      <Route exact path='/' element={<Home/>}></Route>
    </Routes>

    </BrowserRouter>

  );
}

export default App;
